import React from 'react';
import './Header.css';

export default () => {
    return (
        <header>
            <div className="header--logo">
                <a href="/">
                    <img src="https://drive.google.com/file/d/10SFfO0IID5-zDFUQgwl5fL3KCIweuSSx/view?usp=sharing" alt="Americatel" />
                </a>
            </div>
        </header>
    )
}
